INSERT INTO `wp_postmeta` VALUES("337", "146", "content", "« La Reverdie » est une série de peintures à l’huile sur le thème du renouveau. Elle est le nom du printemps au féminin employé au Moyen-Age. cette reverdie m\'a inspiré la représentation d\'une vitalité organique, le bourgeonnement, la régénération, la renaissance. \r\n« La Reverdie », c’est la promesse d’une saison nouvelle, toutes ces forces intérieures expulsées en tremblements de couleurs.");
