INSERT INTO `wp_postmeta` VALUES("586", "209", "bio", "Brève biographie de l\'auteur ou de l\'artiste:\r\nPablo Picasso est né en 1881 en Espagne sous le nom de Pablo Ruiz. Son père est professeur de dessin.\r\nAu cours de ses études à l\'Ecole de Beaux Arts de Barcelone, Pablo Picasso montre un talent\r\nd\'exception. En 1901, il prend le nom de sa mère, Picasso. En 1904, il s\'installe à Paris à Montmartre, à\r\nl\'atelier du Bateau Lavoir.\r\nSa carrière, de peintre et sculpteur, évoluera avec sa vie, ses rencontres, ses émotions.\r\nDe 1901 à 1904, on parle de période Bleue. Ses peintures sont froides et tristes car en 1901, au mois de\r\nfévrier, son grand ami d\'enfance Casagemas se suicide. Picasso sera très affecté.\r\nPuis arrive la période Rose de 1905 à 1906, il tombe amoureux, reprend goût à la vie, prend pour sujet\r\nles thèmes du cirque.\r\nIl fréquente le Louvre et de nombreux amis artistes, côtoie les Fauves, regarde les Impressionnistes, et\r\ns\'intéresse particulièrement à Paul Cézanne. Il rencontre Georges Braque, et avec lui ils inventent le\r\nCubisme. Mais Georges Braque est enrôlé pour la guerre de 1914-1918. Picasso continue de peindre.\r\nToutes ses expériences vont nourrir sa peinture, « j\'ai mis toute ma vie à savoir dessiner comme un\r\nenfant » dira-t-il. Il meurt en 1973.\r\nMais pour Sylvia et rien que pour elle, ilreviendra d\'entre les morts pour boire l\'apéro au vernissage...\r\nWalking dead attitude !");
