INSERT INTO `wp_postmeta` VALUES("674", "201", "content", "Se rencontrer autour d\'un verre, échanger autour du travail de Sylvia...\r\nJérémy et Malodj, assureront l\'ambiance avec leur \"Maloya déjanté\"...\r\nEt pendant ce temps (à Vera Cruz ?) en exclusivité mondiale, Marcel fera office de valet de pot, dans une performance endiablée intitulée \"Des gouts d\'égouts... Dégout!\r\nFiesta!");
