INSERT INTO `wp_postmeta` VALUES("1044", "299", "bio", "Salvador Dalí i Domènech, premier marquis de Dalí de Púbol, né à Figueras le 11 mai 1904, et mort dans la même ville, le 23 janvier 1989, est un peintre, sculpteur, graveur, scénariste et écrivain catalan de nationalité espagnole. Il est considéré comme l\'un des principaux représentants du surréalisme, et comme l\'un des plus célèbres peintres du xxe siècle.");
