INSERT INTO `wp_postmeta` VALUES("1215", "341", "carnet_laius", "Les oeuvres de cette collection sont issu d\'un carnet de repérage, qui constitue au départ un outil de travail, mais qui au fil du temps prennent la forme d\'\"oeuvre de l\'instant \".\r\nDes petits témoignages d\'un moment privilégié, fugace glané dans une rue, au détour d\'un sentier...\r\nUn petit morceau de bonheur couché brièvement sur le papier...\r\nCes moments sont intimes, tout comme ce carnet et ne sauraient être vendues en l\'état.\r\nPar contre ils sont fait pour être partagés.\r\nEt ils initient par la suite d\'autres oeuvres plus abouties, et peuvent également inspirer une commande... \r\nSi cela vous donne des idée ...");
