INSERT INTO `wp_postmeta` VALUES("1621", "394", "carnet_laius", "Un petit morceau de bonheur couché brièvement sur le papier...\r\nCes moments sont intimes, tout comme ce carnet et ne sauraient être vendues en l\'état.\r\nPar contre ils sont fait pour être partagés.\r\nEt ils initient par la suite d\'autres oeuvres plus abouties, et peuvent également inspirer une commande... \r\nSi cela vous donne des idées ...");
