INSERT INTO `wp_postmeta` VALUES("2400", "438", "content", "L\'Atelier du Trait est une association.\r\nTous les lundis, je vous propose des ateliers autour de l\'apprentissage du dessin, tous niveaux confondus. A travers une multitude d\'exercices vous apprendrez à transformer votre regard sur le monde qui vous entoure. Vous êtes invités à participer à la thématique du jour, ou bien à venir avec votre projet. Le dessin se réalise soit avec des moyens simples soit avec des techniques à l\'eau plus complexes.\r\n");
