INSERT INTO `wp_postmeta` VALUES("2896", "453", "texte", "\"Ils sont apparus, comme dans un rêve, au sommet de la dune, à demi cachés par la brume de sable que leurs pieds soulevaient. Lentement ils sont descendus dans la vallée, en suivant la piste presque invisible. En tête de la caravane, il y avait les hommes, enveloppés dans leurs manteaux de laine, leurs visages masqués par le voile bleu. Avec eux marchaient deux ou trois dromadaires, puis les chèvres et les moutons harcelés par les jeunes garçons. Les femmes fermaient la marche....\"");
