INSERT INTO `wp_postmeta` VALUES("3020", "9", "texte", "J\'aime quand sur le marbre je broie un pigment, je plonge dans cette matière pour faire corps avec elle avant le saut vers la toile. Je ne sais plus si c\'est mon bras qui se prolonge dans le pinceau ou si je suis guidée par une couleur, peut-être tout à la fois...On devient chef d\'orchestre au milieu de ses instruments, des pots de pigments, des tubes, des flacons.\r\nJe peints des forces qui sont en moi, qui existent picturalement, couleurs, contrastes, rythme afin d\'écrire ma musique.\r\nJ\'aime passer des heures, des jours à l\'atelier quand tout à coup je me prends d\'aller dessiner le monde, le carnet à la main avec mon pinceau nommé Poil de rat. J\'ai appris, il y a peu, que les peintres calligraphes japonais nommaient leur pinceau, cela montre bien qu\'il ne s\'agit pas de n\'importe quel instrument...");
