INSERT INTO `wp_postmeta` VALUES("3165", "465", "texte_1", "L\'atelier fut longtemps le lieu de mon désir de fuite, il est parfois pus simple et plus agréable d\'aller se promener à l\'extérieur, d\'aller au cinéma, de voir des amis....jusqu\'à ce que le réel se révèle vide, que les amis disparaissent et que les paroles ne soient que bruits. \r\n");
