INSERT INTO `wp_postmeta` VALUES("3179", "467", "sub_1", "Allemagne, Tom waits et chevelure étrange");
INSERT INTO `wp_postmeta` VALUES("3180", "467", "_sub_1", "field_5db71a540adc8");
INSERT INTO `wp_postmeta` VALUES("3181", "467", "texte_1", "Je suis née en 1977, à Poitiers, dans une ferme. Je vis et travaille à Niort. J\'ai la volonté de peindre depuis l\'enfance. La question n\'était donc pas quoi faire, mais comment le faire. Les rencontres, la motivation sont alors décisives et déterminent mon parcours. ");
