INSERT INTO `wp_postmeta` VALUES("3195", "469", "sub_1", "expulser");
INSERT INTO `wp_postmeta` VALUES("3196", "469", "_sub_1", "field_5db71a540adc8");
INSERT INTO `wp_postmeta` VALUES("3197", "469", "texte_1", "Dans mon premier atelier, j\'ai peint un labyrinthe d\'émotions, j\'ai échoué de nombreuses fois face à une toile. L\'art n\'est pas un jeu intellectuel, l\'expérience passe par le corps. Il faut des années...jusqu\'à ce qu\'il y ait techniquement assez de connaissances pour laisser place à la liberté.");
