INSERT INTO `wp_postmeta` VALUES("3211", "472", "sub_1", "tracer sa route");
INSERT INTO `wp_postmeta` VALUES("3212", "472", "_sub_1", "field_5db71a540adc8");
INSERT INTO `wp_postmeta` VALUES("3213", "472", "texte_1", " A l\'oral des Beaux-arts, j\'étais venue avec mes dessins tirés de Goya, Gaugin et du Greco, sans succès... j\'ai fait mon apprentissage dans le décor mural et dans la fresque. Pour moi, c\'était à la fois n\'être que dans des problématiques de terrain et dans la patouille! Plus tard, à la Sorbonne...");
