INSERT INTO `wp_postmeta` VALUES("3227", "474", "sub_1", "Le renouveau");
INSERT INTO `wp_postmeta` VALUES("3228", "474", "_sub_1", "field_5db71a540adc8");
INSERT INTO `wp_postmeta` VALUES("3229", "474", "texte_1", "Je peints lentement, cependant, je peints tous les jours. C\'est une pompe que j\'aurai amorcée qui ne maitrise plus son débit. Je reste docile face à ce qu\'il se passe à l\'atelier, je renouvelle l\' expérience à chaque fois, au-devant de la surprise, au-delà d\'un plan établi.");
