INSERT INTO `wp_postmeta` VALUES("4118", "552", "content", "Depuis deux ans, je parcours les îles et les pointes de Bretagne. Je m\'évade, je marche, je respire et je dessine les rochers, la mer, les mouettes, les couleurs, la lumière de cette région avec mon pinceaux chinois nommé Poil de rat. De retour à l\'atelier, je transforme toutes ces notes picturales en création.");
