INSERT INTO `wp_posts` VALUES("146", "3", "2019-10-10 13:07:30", "2019-10-10 11:07:30", "<!-- wp:paragraph -->\n<p>«&nbsp;La Reverdie&nbsp;» est une série de peintures à l’huile sur le thème du renouveau.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La nature inspire ce changement par le printemps. Il est la renaissance, la régénérescence, le bourgeonnement.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>«&nbsp;La Reverdie&nbsp;», c’est la présence d’une saison nouvelle, toutes ces forces intérieures expulsées en tremblements de couleurs</p>\n<!-- /wp:paragraph -->", "La Reverdie", "", "publish", "closed", "closed", "", "reverdie", "", "", "2019-11-07 22:26:22", "2019-11-07 21:26:22", "", "0", "https://via.yj.fr/?post_type=collections&#038;p=146", "0", "collections", "", "0");
